Example_1:
input: ['.', '.', '.', 'c', 'c', 'c', '.', '.', 'e', '.', '.', '.', '.']
output: ['.', '.', '.', '.', '.', 'c', 'c', 'c', 'e', '.', '.', '.', '.']

Example_2:
input: ['b', 'b', 'b', '.', '.', 'e', '.', '.', '.', '.', '.', '.', '.']
output: ['.', '.', 'b', 'b', 'b', 'e', '.', '.', '.', '.', '.', '.', '.']

Example_3:
input: ['.', '.', '.', 'a', 'a', 'a', 'a', 'a', 'a', '.', '.', '.', 'e']
output: ['.', '.', '.', '.', '.', '.', 'a', 'a', 'a', 'a', 'a', 'a', 'e']

Test case:
input: ['h', 'h', 'h', 'h', 'h', 'h', 'h', 'h', 'h', '.', '.', 'e', '.']

###########################################################
Sample Outputs:
output: ['.', '.', '.', '.', '.', '.', '.', '.', '.', 'h', 'h', 'h', 'e']
*/

public class Solution {
    public String pushDominoes(String dominoes) {
        int len = dominoes.length();
        char[] arr = new char[len];
        Arrays.fill(arr, '.');
        for (int i = 0; i < len; ++i) {
            if (dominoes.charAt(i)!= '.') {
                arr[i] = dominoes.charAt(i);
            }
        }
        // left and right are the index of last non-dot character before current position from left and right respectively
        int left = -1, right = len;
        for (int i = 0; i < len; ++i) {
            if (arr[i] == '.') continue;
            if (left == -1) {
                left = i;
            } else {
                if (arr[left] == 'R' && arr[i] == 'L') {
                    int j = left + 1;
                    while (j < i) {
                        arr[j++] = 'R';
                    }
                }
                left = i;
            }
            if (right == len) {
                right = i;
            } else {
                if (arr[right - 1] == 'L' && arr[i] == 'R') {
                    int j = right - 1;
                    while (j > i) {
                        arr[j--] = 'L';
                    }
                }
                right = i;
            }
        }
        return new String(arr);
    }
}
